    false,nt"url": null,nt"notes": "Mere Brook bisects three former landfills
    at the U.S. Naval Air Station in Brunswick, Maine (NASB). Leachate, soil, and sediment
    analyzed during Superfund remedial investigations at the sites contained elevated
    levels of mercury and other environmental contaminants. At the request of the U.S.
    Environmental Protection Agency and the U.S. Navy, the U.S. Fish and Wildlife Service
    conducted a contaminant study of Mere Brook fish. The purposes of this study were:
    1) to determine the levels of trace element and organochlorine contaminants in Mere
    Brook fish and, 2) to compare these levels with national, regional, and State data.",nt"license_title":
